import React from 'react';
import './Projects.css';

function Projects() {
    return (
        <div className="projects">
            <p>
                Projects will be listed here soon.
                <br></br>
                In the meantime, please check out the links below!
            </p>

            <div className="card">
                <img src="https://storage.googleapis.com/gweb-uniblog-publish-prod/images/HeroHomepage_2880x1200.max-1000x1000.jpg" style="width:100%"/>

            </div>

        </div>
    );
}

export default Projects;
